emp of the thickest part of chicken is at least 175 F.\r\nLet chicken rest for 5 minutes. Brush the chicken with some of the oil. Serve chicken with the sauce over steamed rice (or coconut rice).","strMealThumb":"https://www.themealdb.com/images/media/meals/020z181619788503.jpg","strTags":null,"strYoutube":"https://www.youtube.com/watch?v=9ytR28QK6I8","strIngredient1":"Chicken Thighs","strIngredient2":"Challots","strIngredient3":"Ginger","strIngredient4":"Garlic Clove","strIngredient5":"Cayenne Pepper","strIngredient6":"Turmeric","strIngredient7":"Cumin","strIngredient8":"Coriander","strIngredient9":"Fennel","strIngredient10":"Tamarind Paste","strIngredient11":"Coconut Milk","strIngredient12":"Sugar","strIngredient13":"Water","strIngredient14":"","strIngredient15":"","strIngredient16":"","strIngredient17":"","strIngredient18":"","strIngredient19":"","strIngredient20":"","strMeasure1":"6","strMeasure2":"16","strMeasure3":"1 1/2 ","strMeasure4":"6","strMeasure5":"8","strMeasure6":"2 tbs","strMeasure7":"1 1/2 ","strMeasure8":"1 1/2 ","strMeasure9":"1 1/2 ","strMeasure10":"2 tbs","strMeasure11":"1 can ","strMeasure12":"1 tsp ","strMeasure13":"1 cup ","strMeasure14":" ","strMeasure15":" ","strMeasure16":" ","strMeasure17":" ","strMeasure18":" ","strMeasure19":" ","strMeasure20":" ","strSource":"http://www.curiousnut.com/roasted-spiced-chicken-ayam-percik/","strImageSource":null,"strCreativeCommonsConfirmed":null,"dateModified":null}]

